import React from 'react'

export const RegisterPageOne = () => {

  return (
    <div>
        <form>
            <input type="text" placeholder='enter name'></input>
            <input type="email" placeholder='enter email'></input>
            <button>Next</button>
        </form>

    </div>
  )
}
